let InitialState={
    list:[]
}
const TodoReducer=(InitialState = state,action)=>{
switch(action.type){
    case "To_Add":{
    return {list :[[...state ], state.list.action.payload]}
    }
    default : {
 return{state}
    }
}
}
export default TodoReducer;
